import React, { useState } from 'react'
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import { registerApi } from '../routerApi/userApi';

const Register = () => {
  const [formData, setFormData] = useState({
    username: "",
    email: "",
    password: "",
    confirmPassword: ""
  })
  //onchange form input data
  const onChangeFormData = (e) => {
    const name = e.target.name
    const value = e.target.value
    setFormData((val) => ({ ...val, [name]: value }))
  }
  //on submitting form data into db
  const onSubmitFormData = async () => {
    try {
      const res = await registerApi(formData)
      console.log("data value", res)
    } catch (e) {
      console.log(e)
    }

  }
  return (
    <div>
      <form >
        <TextField id="outlined-basic" label="UserName" variant="outlined" name='username' style={{ margin: '15px' }} onChange={onChangeFormData} />
        <br />
        <TextField id="outlined-basic" label="Email" variant="outlined" name='email' style={{ margin: '15px' }} onChange={onChangeFormData} />
        <br />
        <TextField id="outlined-basic" label="Password" variant="outlined" name='password' style={{ margin: '15px' }} onChange={onChangeFormData} />
        <br />
        <TextField id="outlined-basic" label="Confirm-Password" variant="outlined" name='confirmPassword' style={{ margin: '15px' }} onChange={onChangeFormData} />
        <br />
        <Button variant="contained" style={{ margin: '15px' }} onClick={ons}>Register</Button>

      </form>
    </div>
  )
}

export default Register
